// Header.js
import React, { Component } from 'react';

class Header extends Component {
  constructor () {
    super(this)
  }

  render () {
    return (
      <header className='fixed-top inline'>
        <p>Explore</p>
        <p href='#'>Github</p>
        <p href='#'>Twitter</p>
      </header>
    )
  }
}

export default Header;
